import React from 'react';
import Menubar from '../elements/menubar';
import { useState, useEffect } from 'react';
import { Form, Button, Container, Row, Col } from 'react-bootstrap';
import axios from "axios";
function Recommand () {
  const [userInput, setUserInput] = useState("");
  const onUiChange = (e) => {
    setUserInput(e.target.value);
  };
  const handleSubmit = (e) => {
    // submit을 할 때 페이지 자체가 새로고침이 되는 것을 막음
    e.preventDefault();
    const formData = new FormData();
    formData.append(userInput)
    console.log(formData);
    axios.post('/test', formData, {
        headers: { 'Content-Type': 'multipart/form-data' },
    })
  };
    return(
      <div>
        <header id="header">
          <p id="logo">민법을 적용하는 법</p>
          <Menubar/>
          <p id="login">&nbsp;</p>
          </header>
        <nav id="nav">&nbsp;</nav>
        <div id="section">
          <form onSubmit={onUiChange}>
            <textarea name="input" cols="50" rows="5" value='test' placeholder="여기에 써주세요~"></textarea>
            <input className="btn" type="submit" value="완료"/>
          </form>
        </div>
        <aside id="aside">&nbsp;</aside>
        <footer></footer>
      </div>
    )
}

export default Recommand;
